    false,nt"url": null,nt"notes": "All imagery was collected during the 2014
    Spring flying season during leaf-off conditions for deciduous vegetation in the
    State of South Carolina. The sun angle was at 30-degrees or greater, and streams
    were within their normal banks. During the flight planning and acquisition, a significant
    effort was made to limit clouds, snow, fog, haze, smoke, or other ground obscuring
    conditions in the imagery. In no case does the maximum cloud cover exceed 5% per
    image. Within the immediate areas of power plants, factories, or controlled agricultural
    burns some steam or smoke and/or shadows may be visible on imagery.",nt"license_title":
